import React from 'react'
import './sidebar.css'
import image from './assets/profile.jpg'


export default function Sidebar(){
    return(
        <>
        <div className="container">
            <div className="container-image">
                <div className="container-text">
                <img src={image} />
                </div>
            </div>
        </div>
        </>
    );
}
